import './App.css';

function Login() {
  return (
    <div className="container page-content">
        <h4> Zaloguj się:</h4>
        <hr></hr>
        <form method="post">
            <input type="text" placeholder="nazwa użytkownika"  name="login" maxLength = "40" required></input><br></br>
            <input type="password" placeholder="hasło" name="password" maxLength = "32" required></input><br></br>
            <input type="submit"></input>
        </form>
    </div>
  );
}

export default Login;
